INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("カリン", 4, 29002, 0.0, 0.0, 190801, -409.0, 1, 0, "2019/09/24 15:00:00", "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 0, 29, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("カリン", 5, 30001, 0.0, 0.0, 190801, -409.0, 1, 0, "2019/09/24 15:00:00", "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 0, 30, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("カリン", 6, 30002, 0.0, 0.0, 190801, -409.0, 1, 0, "2019/09/24 15:00:00", "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 0, 30, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("カリン", 7, 31001, 0.0, 0.0, 190801, -409.0, 1, 0, "2019/10/31 12:00:00", "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 0, 31, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("カリン", 8, 31002, 0.0, 0.0, 190801, -409.0, 1, 0, "2019/10/31 12:00:00", "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 0, 31, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("カリン", 1, 32001, 0.0, 0.0, 190801, -409.0, 1, 0, "2019/12/20 5:00:00", "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 0, 32, 1, "2020/01/04 4:59:59");
