INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("カリン", 3, 33001, 0.0, 0.0, 190801, -409.0, 1, 0, "2019/12/20 5:00:00", "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 0, 33, 1, "2020/01/04 4:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("カリン", 4, 33002, 0.0, 0.0, 190801, -409.0, 1, 0, "2019/12/20 5:00:00", "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 0, 33, 1, "2020/01/04 4:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("カリン", 5, 34001, 0.0, 0.0, 190801, -409.0, 1, 0, "2020/01/04 5:00:00", "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 0, 34, 1, "2020/01/10 11:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("カリン", 6, 34002, 0.0, 0.0, 190801, -409.0, 1, 0, "2020/01/04 5:00:00", "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 0, 34, 1, "2020/01/10 11:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("ペコリーヌ", 1, 38001, 5.3, 0.0, 105801, -458.0, 2, 0, "2015/12/17 15:00:00", "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 0, 38, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("ペコリーヌ", 2, 38002, 6.5, 0.0, 105801, -458.0, 2, 0, "2015/12/17 15:00:00", "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 0, 38, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("ペコリーヌ", 0, 39005, 0.0, 9999.0, 105801, 9999.0, 3, 0, "2020/04/01", "", 0, 39, 3, "2020/04/08 23:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("カリン", 2, 40001, 0.0, 0.0, 190801, -430.0, 1, 0, "2015/12/17 15:00:00", "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 0, 40, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("シェフィ", 1, 41001, 0.0, 0.0, 106401, -363.0, 1, 0, "2015/12/17 15:00:00", "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 2104010, 41, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("ペコリーヌ", 1, 41002, 0.0, 0.0, 105801, -363.0, 1, 0, "2015/12/17 15:00:00", "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 0, 41, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("キャル", 1, 41003, 0.0, 0.0, 106001, -363.0, 1, 0, "2015/12/17 15:00:00", "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 0, 41, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("コッコロ", 1, 41004, 0.0, 0.0, 105901, -363.0, 1, 0, "2015/12/17 15:00:00", "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 0, 41, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("コッコロ", 1, 42001, 0.0, 0.0, 105901, -416.5, 1, 0, "2015/12/17 15:00:00", "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 0, 42, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("シェフィ", 1, 42002, 0.0, 0.0, 106401, -416.5, 1, 0, "2015/12/17 15:00:00", "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 2104010, 42, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("ペコリーヌ", 1, 42003, 0.0, 0.0, 105801, -416.5, 1, 0, "2015/12/17 15:00:00", "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 0, 42, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("キャル", 1, 42004, 0.0, 0.0, 106001, -416.5, 1, 0, "2015/12/17 15:00:00", "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 0, 42, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("ペコリーヌ", 1, 43001, 0.0, 0.0, 105801, -363.0, 1, 0, "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 0, 43, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("コッコロ", 1, 43002, 0.0, 0.0, 105901, -363.0, 1, 0, "2015/12/17 15:00:00", "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 0, 43, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("キャル", 1, 43003, 0.0, 0.0, 106001, -363.0, 1, 0, "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 0, 43, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("アメス", 1, 43004, 0.0, 0.0, 123001, -416.5, 1, 0, "2015/12/17 15:00:00", "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 0, 44, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("アメス", 2, 43005, 0.0, 0.0, 123001, -416.5, 1, 0, "2015/12/17 15:00:00", "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 0, 44, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES ("アメス", 3, 43006, 5.79, 0.0, 123001, -416.5, 2, 0, "2015/12/17 15:00:00", "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 0, 45, 1, "2030/12/17 14:59:59");
